import {Bar, Line} from 'react-chartjs-2';
import Hooks from ''

const Chart = () => {
    const [data, setData] = useState({data: {
        labels:['Boston', 'Worcester', 'Springfield', 'Lowel', 'Cambridge', 'New Bedford'],
        datasets:[
            {
            label: 'Population',
            data: [
                60000,
                50000,
                40000,
                20000,
                11000,
                10000
            ],
            backgroundColor: '#2ad183',
        },
        {
            label: 'Population',
            data: [
                60000,
                50000,
                40000,
                20000,
                11000,
                10000
            ],
            backgroundColor: '#5985f1'
        }
        ]
    }});
    return (
        <div className="chart">
            <Bar
              data={data}
              options={{
                  maintainAspectRatio: false
              }}


            />
        </div>
    );
}

export default Chart;
